import React from 'react';




const ShoppingList = () => {
  const users = [
    { title : 'test' ,  id : 1},
    { title : 'user' ,  id : 2},
    { title : 'xyz' ,  id : 3},
    { title : 'helow' ,  id : 4},
    { title : 'world' ,  id : 5}
  ]


  const listitems =  users.map(names =>
    <li
    key = {names.id}
    >

      {names.title}
    </li>
    )

    return(
    <ul>
      {listitems}
    </ul>
    );
}

export default ShoppingList;
